import React from 'react';
import AppAbout from '../component/home/about';
import AppContact from '../component/home/contact';
import AppHomes from '../component/home/homes';
import AppFeatures from '../component/home/features';

export default function AppHome() {
    return(
        <div className="main">
            <AppHomes/>
            <AppFeatures/>
            <AppAbout/>
            <AppContact/>
        </div>
    )
}
